import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { NgForm } from '@angular/forms';

interface PredictionResponse {
  predicted_price: number;
}

@Component({
  selector: 'app-predict-land',
  template: `
    <div class="container p-4">
      <h2>Land Price Prediction</h2>
      <form #predictForm="ngForm" (ngSubmit)="onSubmit(predictForm)">
        <div class="mb-3">
          <label for="year" class="form-label">Year</label>
          <input type="number" id="year" name="year" class="form-control" required
                 [(ngModel)]="year">
        </div>
        <div class="mb-3">
          <label for="state" class="form-label">State (encoded)</label>
          <input type="number" id="state" name="state" class="form-control" required
                 [(ngModel)]="stateEncoded">
        </div>
        <div class="mb-3">
          <label for="landUse" class="form-label">Land Use (encoded)</label>
          <input type="number" id="landUse" name="landUse" class="form-control" required
                 [(ngModel)]="landUseEncoded">
        </div>
        <button type="submit" class="btn btn-primary" [disabled]="predicting">
          {{ predicting ? 'Predicting...' : 'Predict Price' }}
        </button>
      </form>

      <div *ngIf="predictedPrice !== null" class="alert alert-success mt-3">
        <strong>Predicted Price (USD/m²):</strong> {{ predictedPrice | number:'1.2-2' }}
      </div>
    </div>
  `,
  styles: [`
    .container { max-width: 400px; margin: auto; }
  `]
})
export class PredictLandComponent {
  year!: number;
  stateEncoded!: number;
  landUseEncoded!: number;
  predictedPrice: number | null = null;
  predicting = false;

  // Total number of features your model expects
  private inputDim = 25;
  private apiUrl = 'http://localhost:4000/predict';

  constructor(private http: HttpClient) {}

  onSubmit(form: NgForm) {
    if (form.invalid) return;
    // Build feature vector: first three from form, rest zeros
    const zeros = Array(this.inputDim - 3).fill(0);
    const features = [
      this.year,
      this.stateEncoded,
      this.landUseEncoded,
      ...zeros
    ];

    this.predicting = true;
    this.predictedPrice = null;

    this.http.post<PredictionResponse>(this.apiUrl, { features })
      .subscribe({
        next: (resp) => {
          this.predictedPrice = resp.predicted_price;
          this.predicting = false;
        },
        error: (err) => {
          console.error('Prediction error', err);
          this.predicting = false;
        }
      });
  }
}
